import React from 'react';
import styles from '../../core/styles/components.module.css';

// Helper function to download data as JSON
const downloadJSON = (data, filename) => {
    const json = JSON.stringify(data, null, 2);
    const blob = new Blob([json], { type: 'application/json' });
    const href = URL.createObjectURL(blob);

    const link = document.createElement('a');
    link.href = href;
    link.download = filename;
    document.body.appendChild(link);
    link.click();

    document.body.removeChild(link);
    URL.revokeObjectURL(href);
};

// In-house Marketing Assessment Results View
const InhouseResultsView = ({ results }) => {
    console.log('InhouseResultsView received results:', results);

    // Check if results is undefined or missing
    if (!results) {
        console.error('InhouseResultsView: results prop is undefined or null');
        return <div className={styles.errorMessage}>No results data available. Please try again.</div>;
    }

    // Log all the keys in the results object
    console.log('InhouseResultsView results keys:', Object.keys(results));

    const { executiveSummary, marketPosition, quickWins, strategicRoadmap, expectedOutcomes, nextSteps } = results;

    // Check if required properties exist
    console.log('Executive Summary data:', executiveSummary);
    console.log('Market Position data:', marketPosition);
    console.log('Quick Wins data:', quickWins);
    console.log('Strategic Roadmap data:', strategicRoadmap);
    console.log('Expected Outcomes data:', expectedOutcomes);
    console.log('Next Steps data:', nextSteps);

    // Early validation to catch issues
    if (!executiveSummary || !marketPosition || !quickWins || !strategicRoadmap || !expectedOutcomes || !nextSteps) {
        console.error('InhouseResultsView: Missing required sections in results', {
            hasExecutiveSummary: !!executiveSummary,
            hasMarketPosition: !!marketPosition,
            hasQuickWins: !!quickWins,
            hasStrategicRoadmap: !!strategicRoadmap,
            hasExpectedOutcomes: !!expectedOutcomes,
            hasNextSteps: !!nextSteps
        });
        return (
            <div className={styles.errorMessage}>
                <h2>Incomplete Results Data</h2>
                <p>Some required sections of the report are missing. The following sections are available:</p>
                <ul>
                    {executiveSummary && <li>Executive Summary</li>}
                    {marketPosition && <li>Market Position</li>}
                    {quickWins && <li>Quick Wins</li>}
                    {strategicRoadmap && <li>Strategic Roadmap</li>}
                    {expectedOutcomes && <li>Expected Outcomes</li>}
                    {nextSteps && <li>Next Steps</li>}
                </ul>
            </div>
        );
    }

    // Calculate overall effectiveness based on headline
    const getOverallScore = () => {
        if (!executiveSummary || !executiveSummary.headline) return 50;
        const headline = executiveSummary.headline.toLowerCase();
        if (headline.includes('urgent action') || headline.includes('at risk')) return 35;
        if (headline.includes('early stage') || headline.includes('adapting')) return 55;
        if (headline.includes('building capability') || headline.includes('keeping pace')) return 75;
        if (headline.includes('transformation ready') || headline.includes('leading')) return 90;
        return 65; // Default middle score
    };

    const overallScore = getOverallScore();

    return (
        <div className={styles.resultsContainer}>
            {/* Executive Summary */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>Executive Summary</h2>
                <div className={styles.resultsHeader}>
                    <div className={styles.scoreSection}>
                        <div className={styles.scoreCircle}>
                            <svg width="200" height="200">
                                <circle cx="100" cy="100" r="90" stroke="rgba(255,255,255,0.1)" strokeWidth="12" fill="none"/>
                                <circle cx="100" cy="100" r="90" stroke="#4caf50" strokeWidth="12" fill="none"
                                    strokeDasharray={`${overallScore * 5.65} 565`}
                                    strokeLinecap="round"
                                />
                            </svg>
                            <div className={styles.scoreValue}>{overallScore}</div>
                            <div className={styles.scoreLabel}>AI Readiness</div>
                        </div>
                    </div>

                    <div className={styles.headlineSection}>
                        <h1>{executiveSummary.headline}</h1>
                        <p className={styles.subheadline}>{executiveSummary.marketContext}</p>

                        <div className={styles.narrative}>
                            <p><strong>{executiveSummary.criticalInsight}</strong></p>
                            <p>{executiveSummary.bottomLine}</p>
                        </div>
                    </div>
                </div>
            </div>

            {/* Market Position */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>Your Market Position</h2>
                <div className={styles.positionIndicator}>
                    <h3 className={styles.positionHeading}>{marketPosition.quartile} - {marketPosition.message}</h3>
                    <p>{marketPosition.implication}</p>
                    <p className={styles.competitorNote}>{marketPosition.competitorActions}</p>
                    <div className={styles.urgencyIndicator}>
                        <span className={styles.urgencyLabel}>Time to Act:</span> 
                        <span className={styles.urgencyValue}>{marketPosition.timeToAct}</span>
                    </div>
                </div>
            </div>

            {/* Quick Wins */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>Quick Wins to Start This Week</h2>
                <div className={styles.recommendationsGrid}>
                    {quickWins.map((win, idx) => (
                        <div key={idx} className={styles.recommendationCard}>
                            <div className={styles.recommendationTitle}>{win.title}</div>
                            <div className={styles.recommendationContent}>
                                <p><strong>Why:</strong> {win.why}</p>
                                <p><strong>How:</strong> {win.how}</p>
                                <p><strong>Action:</strong> {win.specificAction}</p>
                                <p><strong>Result:</strong> {win.expectedResult}</p>
                            </div>
                            <div className={styles.recommendationFooter}>
                                <span className={styles.marketContext}>{win.marketContext}</span>
                                <span className={styles.investmentTag}>{win.investment}</span>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            {/* Strategic Roadmap */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>{strategicRoadmap.overview}</h2>
                <div className={styles.roadmapTimeline}>
                    <div className={styles.roadmapPhase}>
                        <div className={styles.phaseHeader}>
                            <h3 className={styles.phaseName}>{strategicRoadmap.phase1.name}</h3>
                            <p className={styles.phaseFocus}>{strategicRoadmap.phase1.focus}</p>
                        </div>
                        <ul className={styles.phaseActions}>
                            {strategicRoadmap.phase1.actions.map((action, idx) => (
                                <li key={idx}>{action}</li>
                            ))}
                        </ul>
                        <p className={styles.phaseOutcome}>{strategicRoadmap.phase1.expectedOutcome}</p>
                    </div>

                    <div className={styles.roadmapPhase}>
                        <div className={styles.phaseHeader}>
                            <h3 className={styles.phaseName}>{strategicRoadmap.phase2.name}</h3>
                            <p className={styles.phaseFocus}>{strategicRoadmap.phase2.focus}</p>
                        </div>
                        <ul className={styles.phaseActions}>
                            {strategicRoadmap.phase2.actions.map((action, idx) => (
                                <li key={idx}>{action}</li>
                            ))}
                        </ul>
                        <p className={styles.phaseOutcome}>{strategicRoadmap.phase2.expectedOutcome}</p>
                    </div>

                    <div className={styles.roadmapPhase}>
                        <div className={styles.phaseHeader}>
                            <h3 className={styles.phaseName}>{strategicRoadmap.phase3.name}</h3>
                            <p className={styles.phaseFocus}>{strategicRoadmap.phase3.focus}</p>
                        </div>
                        <ul className={styles.phaseActions}>
                            {strategicRoadmap.phase3.actions.map((action, idx) => (
                                <li key={idx}>{action}</li>
                            ))}
                        </ul>
                        <p className={styles.phaseOutcome}>{strategicRoadmap.phase3.expectedOutcome}</p>
                    </div>
                </div>

                <div className={styles.investmentGuide}>
                    <strong>Investment Required:</strong> {strategicRoadmap.investmentGuide}
                </div>
            </div>

            {/* Expected Outcomes */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>Expected Outcomes</h2>
                <div className={styles.outcomesGrid}>
                    {expectedOutcomes.map((outcome, idx) => (
                        <div key={idx} className={styles.outcomeCard}>
                            <h3 className={styles.outcomeArea}>{outcome.area}</h3>
                            <div className={styles.outcomeDetails}>
                                <p className={styles.outcomeMetric}><strong>Key Metric:</strong> {outcome.keyMetric}</p>
                                <p className={styles.outcomeBaseline}><strong>Current:</strong> {outcome.baseline}</p>
                                <p className={styles.outcomeTarget}><strong>Target:</strong> {outcome.target}</p>
                                <p className={styles.outcomeTimeframe}><strong>Timeframe:</strong> {outcome.timeframe}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            {/* Next Steps */}
            <div className={styles.reportSection}>
                <h2 className={styles.sectionHeading}>Next Steps</h2>
                <div className={styles.ctaContainer}>
                    <div className={styles.ctaPrimary}>
                        <h3 className={styles.ctaTitle}>{nextSteps.primaryCTA.title}</h3>
                        <p className={styles.ctaDescription}>{nextSteps.primaryCTA.description}</p>
                        <a href={nextSteps.primaryCTA.link} className={styles.ctaButton}>
                            {nextSteps.primaryCTA.buttonText}
                        </a>
                    </div>

                    <div className={styles.ctaAlternatives}>
                        <h4>Other Options:</h4>
                        <ul>
                            {nextSteps.alternatives.map((alt, idx) => (
                                <li key={idx}>
                                    <a href={alt.link} className={styles.alternativeLink}>{alt.text}</a>
                                    <span className={styles.alternativeDesc}> - {alt.description}</span>
                                </li>
                            ))}
                        </ul>
                    </div>
                </div>
            </div>

            {/* Download Raw Data */}
            <div className={styles.reportSection}>
                <div className={styles.downloadSection}>
                    <h3 className={styles.downloadHeading}>Assessment Data</h3>
                    <p className={styles.downloadDescription}>
                        Download your complete assessment data for reference or to share with your team.
                    </p>
                    <button 
                        className={styles.downloadButton}
                        onClick={() => downloadJSON(results._rawData || results, 'inhouse-marketing-assessment-data.json')}
                    >
                        Download Complete JSON Data
                    </button>
                </div>
            </div>
        </div>
    );
};

export default InhouseResultsView;
